const zlib = require("zlib")
const { log, LogLevel } = require("@peacockproject/core/loggingInterop")
const { Buffer } = require("buffer")
const { uuidRegex } = require("@peacockproject/core/utils")

function decompress(input) {
    return JSON.parse(
        zlib.brotliDecompressSync(Buffer.from(input, "base64")).toString()
    )
}

// reduces the plugin file size by a couple hundred kb

const blobs = decompress(
    ""
)
const escalations = decompress(
    ""
)

function imagePathFromCodename(hint) {
    // handle some edge cases, mainly IOI typos
    if (hint === "bloodlily ") {
        hint = "bloodlily"
    }
    if (hint === "scullcap") {
        hint = "skullcap"
    }
    if (hint === "moonflower") {
        hint = "moon_flower"
    }

    return blobs.find(
        (n) =>
            n.includes(hint) &&
            !(
                // the escalation with codename "rose" triggers on sean rose,
                // desert rose, and primrose. that is not what we want
                (
                    (n.includes("sean") ||
                        n.includes("bull") ||
                        n.includes("desert") ||
                        n.includes("prim")) &&
                    hint === "rose"
                )
            )
    )
}

function reformatCodeNameHint(hint) {
    return (
        hint
            .toLowerCase()
            // everything before " - "
            .split(" - ")[0]
            // remove spaces
            .replace(" ", "")
            // everything before "level"
            .split("level")[0]
    )
}

module.exports = function legacyEscalationsPlugin(controller) {
    let finalAddedCount = 0

    for (const group of Object.keys(escalations)) {
        if (
            group === undefined ||
            !uuidRegex.test(group) ||
            group === "7151ef94-a1e5-4b61-a542-cafa19c49a70" ||
            group === "a6807292-1bc5-4fbb-9421-af3f5a2ee5d9"
        ) {
            continue
        }

        const levelMap = {}

        escalations[group].forEach((level) => {
            const levelNumber =
                parseInt(
                    level.Metadata.Title.split("").find((str) =>
                        ["1", "2", "3", "4", "5"].includes(str)
                    )
                ) - 1

            level.Metadata.TileImage = imagePathFromCodename(
                reformatCodeNameHint(level.Metadata.CodeName_Hint)
            )

            levelMap[levelNumber] = level
        })

        try {
            controller.addEscalation(
                levelMap[0].Metadata.InGroup,
                levelMap[0].Metadata.Location,
                levelMap[0],
                levelMap[1],
                levelMap[2],
                levelMap[3],
                levelMap[4]
            )

            finalAddedCount++
        } catch (e) {
            debugger
        }
    }

    log(
        LogLevel.INFO,
        `[Legacy Escalations Plugin] Added ${finalAddedCount} escalations successfully!`
    )
}
